import React, {useState, useEffect} from 'react';
import './App.css';
import axios from 'axios';

const App = () => {

  const [code, setCode] = useState("");
  const [result, setResult] = useState("");

  const req = {
    content: "Hello API",
    language: "viz"
  };

  useEffect(() => {
    const get = async () => {
      const res = await axios.post("http://localhost:5001/run", req);
      setResult(res.data);
    }
    get();
  }, [])

  return (
    <div>
      <textarea
        rows="20"
        cols="75"
        value={code}
        onChange={(e) => {
          setCode(e.target.value);
        }}
      ></textarea>
      Hello
      {result}
    </div>
  );
}

export default App;
